let newsData=(ele)=>{
    let newsSection = document.getElementById("newsInDetails");
    newsSection.innerHTML=null;
    let hline = document.createElement("h2");
           
    hline.innerText= ele.hline;
    let img = document.createElement("img");
    


    img.src=`https://www.cricbuzz.com/a/img/v1/595x396/i1/c${ele.imageId}/jonny-bairstow-hammered-a-92-b.jpg`;
    let intro = document.createElement("p");
           
    intro.innerText= ele.intro;
    newsSection.append(hline,img,intro);

}




let newsToHome=(array)=>{
    array.map(function(ele,index){
        if(index!==1 && index!==6){
        
           let hline = document.createElement("a");
        
           hline.innerText= ele.story.hline;
           hline.addEventListener("click",function(){
             newsData(ele.story);
           })
           document.getElementById("news_home").append(hline);
        }
    })
    newsData(array[0].story);
}

newsToHome(array);



